import React from "react";

const Home = () => {
    return <div className="homePageWrapper">
        <div className="formWrapper">
            <img src="/code-sync.png" alt="code-sync-logo" />
            <h4 className="mainLabel">Paste invitation ROOM ID</h4>
        </div>
    </div>
};

export default Home;
